import React from "react";
import Flatlist from "../Flatlist";
import "../../map.css";
import "./style.css";

const Hero = (props) => {
   const {plants}=props;
   return (
        <div id="hero">
        {plants.length? <Flatlist plants={plants}/> : <div></div>}
        

        </div>
   );
};
      
export default Hero;
